import React from 'react';

const Headings = () => {
  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='mainTitle pb2'>
          <h5 className='fontStyled fsH5 primary'>Headings:</h5>
        </div>
        <div className='row alignCenter mb1'>
          <div className='col3'>
            <p className='fsSM fwBold'>.fontDefault:</p>
          </div>
        </div>{' '}
      </div>
    </>
  );
};

export default Headings;
